	('proktor', 'Proktor xxx', 'yBINSERT INTO `soal` (`ujian_id`, `no_soal`, `essay`, `konten`, `jawaban`, `skor`, `indikator`) VALUES
	('NYSD9TFQOQ', 1, '0', '<p style="text-align: center"><span style="font-size:13pt"><span style="color:black"><strong>KOMODO DRAGON</strong></span>\n							</span></p><p style="text-align: justify; margin-left: 8pt"><span style="color:black">The Komodo Dragon is the world\'s biggest lizard. It is a reptile, a cold-blooded animal. It is diurnal, most active during the day. The Komodo Dragon is a fast runner; it can run up to 11 mph (18 kph). It is also a good tree climber and swimmer.</span>\n						</p><p style="text-align: justify; margin-left: 8pt"><span style="color:black">The Komodo Dragon\'s scientific name is <em>Varanus komodoensis</em>. It is in danger of extinction because of habitat lost. Its life span is about 20 years. </span>\n						</p><p style="text-align: justify; margin-left: 8pt"><span style="color:black">      Komodo Dragons live on islands in Indonesia, including the island of Komodo. They live in hot, humid, grassy lowlands and in rainforests. </span>\n						</p><p style="margin-left: 7pt"><span style="color:black">The Komodo Dragon is about 9 feet (2.8 m) long, but can get up to 10 feet (3 m) long and weighs up to 300 pounds (135 kg). It has large jaws, four short legs, and fivetoed feet with sharp claws. The tail is longer than the body. It senses chemicals with a long, yellow, forked tongue.\n</span></p><p style="margin-left: 7pt">\n</p><p style="margin-left: 7pt"><span style="color:black">What is the text about?<span style="font-family:Times New Roman">\n								</span></span></p>', 'B', 2.5, 'Indikator 1'),
