	('NYSD9TFQOQ', 48, '1', '<p><img src="images/2019/02/03/5c56349512f3a.png" alt=""/><strong>\n							</strong></p><p><span style="color:black; font-size:12pt; background-color:white">The hawk flew down from the sky and asked the hen,"<span style="text-decoration:underline"><strong>will you marry me?</strong></span>"(paragraph 1).\n</span></p><p><span style="color:black; font-size:12pt; background-color:white">What does the underlined utterance mean?</span><strong>\n							</strong></p><p>c\n</p><p>2</p>', '', 2.5, 'Indikator essay 1'),
	('NYSD9TFQOQ', 49, '1', '<p><span style="color:black; font-size:12pt"><span style="background-color:white"><strong>Arrange the following sentences into a good paragraph</strong></span><br/><span style="background-color:white">1. It all happened very quickly, people just stood and watched.</span><br/><span style="background-color:white">2. A car stopped outside the shop, and two men go out.</span><br/><span style="background-color:white">3. He threw the brick at the windows and smashed it.</span><br/><span style="background-color:white">4. They had masks on.</span><br/><span style="background-color:white">5. One of them held a brick in his hand.</span><br/><span style="background-color:white">6. One man took the coats from the window and the other put them in the back of the car.\n</span></span></p><p><span style="color:black; font-size:12pt"><br/><span style="background-color:white">The correct arrangement of the sentences is .....</span><br/></span>\n						</p><p>b\n</p><p>2</p>', '', 2.5, 'Indikator essay 2'),
	('NYSD9TFQOQ', 50, '1', '<p><span style="text-decoration:underline">being</span>  <span style="text-decoration:underline">OSIS</span>  <span style="text-decoration:underline">on</span>  <span style="text-decoration:underline">Congratulation</span>  <span style="text-decoration:underline">elected</span>  <span style="text-decoration:underline">chairperson</span>  <span style="text-decoration:underline">as\n</span></p><p>   1           2        3                 4                      5                  6                 7\n</p><p>\n</p><p>The correct arrangement is<span style="text-decoration:underline">\n							</span></p><p>b\n</p><p>2</p>', '', 2.5, 'Indikator essay 3');
